import React from "react";

const Card = ( {data}) => {
  return (
    <div>
      {data[0].map(item => (
        <div className="card">
          <p>{item.title}</p>
          <p>{item.name}</p>
        </div>  
        ))}
    </div>
  );
      };

export default Card;
